import React from "react";
import styled from "styled-components";

import Package from "../../Package";
import "./style.css";
const cnst_bg = require("../../../assets/cnst_bg6.jpg").default;

const Input = styled.input`
  width: 90%;
  height: 50px;
  padding: 5px;
  margin-top: 30px;
  border: 0;
  border-bottom: 1px solid;
  outline: none;
  font-size: 20px;
  background-color: #4a148c;
  color: white;
  border-radius: 4px;

  input::-webkit-outer-spin-button,
  input::-webkit-inner-spin-button {
    -webkit-appearance: none;
    margin: 0;
  }

  /* Firefox */
  input[type="number"] {
    -moz-appearance: textfield;
  }
`;

const Form = styled.div`
  height: 450px;
  max-width: 400px;
  min-width: 400px;
  background-color: #4a148c;
  margin-top: 5%;
  opacity: 0.8;
  border-radius: 10px;

  @media screen and (max-width: 850px) {
    margin-top: 15%;
  }
`;

const Main = styled.div`
  height: 70vh;
  width: 100%;
  text-align: center;
  justify-content: space-around;
  color: white;
  background-image: url(${cnst_bg});
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
`;

const Construction = () => {
  return (
    <>
      <div className="row">
        <Main className="row">
          <div className="col" style={{ maxWidth: "50%", minWidth: 400 }}>
            <p style={{ fontSize: 45, fontWeight: "bold", marginTop: "10%" }}>
              We build quality Homes
            </p>
            <p style={{ fontSize: 25 }}>100% Hassle-Free and managed by us!</p>
          </div>
          <Form className="col border-primary">
            <Input placeholder="Your name" type="text" />
            <Input placeholder="Your contact number" type="number" />
            <Input placeholder="Your email" type="email" />
            <Input placeholder="Your city" type="text" />
            <button
              style={{ flex: 1, margin: 20 }}
              type="submit"
              class="btn btn-primary btn-lg btn-block"
            >
              Submit
            </button>
          </Form>
        </Main>
        <div style={{ textAlign: "center", marginTop: 20 }}>
          <h1>Our Packages</h1>
          <div>
            <Package />
          </div>
        </div>
      </div>
    </>
  );
};

export default Construction;

// echo "# construction" >> README.md
// git init
// git add README.md
// git commit -m "first commit"
// git branch -M main
// git remote add origin https://github.com/karim-coder/construction.git
// git push -u origin main
